function RecipeList() {
  const recipes = [
    { id: 1, name: 'Pasta', ingredients: ['Pasta', 'Tomato'], instructions: 'Boil Pasta' },
    { id: 2, name: 'Pizza', ingredients: ['Dough', 'Cheese'], instructions: 'Bake Pizza' }
  ];

  return (
    <div>
      {recipes.map((recipe) => (
        <div key={recipe.id}>
          <h2>{recipe.name}</h2>
          <p>{recipe.instructions}</p>
        </div>
      ))}
    </div>
  );
}

export default RecipeList;
